const http = require("https"); // АЦУДОВА начинать счет строк


const STANDARD_LongPollWait = 25; // Стандартное время ожидания лонгполла
const STANDARD_LongPollVersion = 3; // Стандартная версия User Long Poll
const STANDARD_LongPollMode = 2; // Доп. опции лонгполла по стандарту
const STANDARD_Version = "5.101"; // Версия VK Api


function method(access_token, method_name, method_params, callback=null, version=STANDARD_Version){ // дабстеп таджикских вооруженных сил
	const uriparams = encodeURI(Object.keys(method_params).map(key => key + '=' + method_params[key]).join('&')); // я НЕ ПИШУ посты о том, как меня все хотят убить нахуй
	http.get("https://api.vk.com/method/" + method_name + "?v=" + version + "&access_token=" + access_token + "&" + uriparams, response => { // здесь можно словить шизу
		response.setEncoding("utf8"); // а на русском слабо
		if (callback != null){ //дабстеп вооруженных сил таджикистана
			response.on("data", data => { // Skrillex - Bangarang
				callback(JSON.parse(data)); // Вы находитесь здесь
			}); // ЕБАНЫЙ БУРУНДУК !!!!!!!!!!!!!!!!!
		} // ХВАТИТ В МЕНЯ ПЕРДЕТЬ!
	}); // гимн днр
}; // первый callback hell

function groupLongPoll(access_token, group_id, callback, wait=STANDARD_LongPollWait, version=STANDARD_Version){ //д дабстеп узбекских вооруженных сил
	http.get("https://api.vk.com/method/groups.getLongPollServer?v=" + version + "&access_token=" + access_token + "&group_id=" + group_id, response => { // моторола умер
		response.setEncoding("utf8"); // индус ебаный
		response.on("data", getLongPoll => { // Индекс вязкости моторного масла ... (ИВ) — это относительная величина,
			const LongPollServer = JSON.parse(getLongPoll); // показывающая степень изменения вязкости масла в зависимости от
			if (LongPollServer.hasOwnProperty("response")){ // температуры в градусах Цельсия и определяющая пологость кривой
				const response = LongPollServer.response; // кинематической вязкости от температуры.
				http.get(response.server + "?act=a_check&key=" + response.key + "&ts=" + response.ts + "&wait=" + wait, LongPollResponse => { // гиви тоже умер
					LongPollResponse.setEncoding("utf8") // УЗНАЙТЕ РОДИТЕЛЕЙ ЭТИХ УБЛЮДКОВ
					LongPollResponse.on("data", data => { // УЗНАЙТЕ ЭТИХ УБЛЮДКОВ
						callback(JSON.parse(data)); // ПЕРЕВЕРНИТЕ ТАМ ВСЕ ВВЕРХ ДНОМ
						groupLongPoll(access_token, group_id, callback); // НО НАКАЖИТЕ, НАКАЖИТЕ ЭТИХ МРАЗЕЙ!
					}); // ЭТО ЖИВОТНЫЕ, КОТОРЫЕ НЕ ДОСТОЙНЫ ЖИТЬ!
				}); // ОНИ НЕ ДОСТОЙНЫ ДЫШАТЬ, ОНИ НЕ ДОСТОЙНЫ НАХОДИТЬСЯ НА ТЕРРИТОРИИ ЛЮБОЙ СТРАНЫ!
			} //второй callback hell начинается
			else{ // В версиях о том, кто и когда придумал граненый стакан, можно найти и фамилию Малевича. В 1930 году, когда художник второй раз сидел в тюрьме, он обратил внимание на круглые стаканы: хрупкое стекло легко ломалось, опекая руки горячим чаем. Тогда Малевичу и пришла на ум идея создать стакан-многогранник, жесткость которого значительно увеличивается с добавлением углов. Освободившись, Казимир Северинович поделился своей идеей со скульптором Верой Мухиной, известным автором монумента «Рабочий и колхозница». Подключив знакомых, Мухина смогла запустить массовое производство граненых стаканов.
				console.log(getLongPoll); // ты опять на связь выходишь мудило
			}; // Мои вкусы специфичны, ты не поймешь
		}); // Посвяти же меня в них
	}); // Больной ублюдок
}; // второй callback hell

function userLongPoll(access_token, callback, wait=STANDARD_LongPollWait, mode=STANDARD_LongPollMode, LongPollVersion=STANDARD_LongPollVersion, apiVersion=STANDARD_Version){ // горит пизда
	http.get("https://api.vk.com/method/messages.getLongPollServer?v=" + apiVersion + "&access_token=" + access_token, response => { // идем по второму кругу
		response.setEncoding("utf8"); //китаеза
		response.on("data", getLongPoll => { // РЫНОЧНАЯ ЭКОНОМИКА - ЭТО КОГДА = 1 % НАСЕЛЕНИЯ - ЗАХВАТИЛ = 90 % ДЕНЕГ ВСЕЙ СТРАНЫ !!!!!!!!!!  
			const LongPollServer = JSON.parse(getLongPoll); // НИКАК НЕ ВЫЖИВАТЬ !!!!!!!! 
			if (LongPollServer.hasOwnProperty("response")){ // 50 % НАСЕЛЕНИЯ РОССИИ - БУДЕТ УНИЧТОЖЕНО ГОЛОДОМ И НИЩЕТОЙ !!!!!!!!
				const response = LongPollServer.response; // НИКАКИЕ ЧАСТНЫЕ КАФЕ - ПАРИКМАХЕРСКИЕ И ПЕКАРНИ - РОССИЮ НЕ СПАСУТ !!!!!!!!!
				http.get("https://" + response.server + "?act=a_check&key=" + response.key + "&ts=" + response.ts + "&wait=" + wait + "&mode=" + mode + "&version=" + LongPollVersion, LongPollResponse => { // data:image/jpeg;base64, 
					LongPollResponse.setEncoding("utf8") // пупа и лупа пошли получать зарплату
					LongPollResponse.on("data", data => { // в бухгалтерии все перепутали и лупа получил за пупу
						callback(JSON.parse(data)); // а пупа = ЗАЛУПУ !!!!!!!!!!!!!!!!!!!!
						userLongPoll(access_token, callback, wait, mode, LongPollVersion, apiVersion); // я сатанист зиг хайль
					}); // а все знаете почему? 
				}); // потому что мне лень делать это в одной функции да и так некрасиво получится
			} // третий callback hell начинается
			else{ // я сосал меня ебали
				console.log(getLongPoll); // колесо сансары дало оборот
			}; //если вы случайно наткнулись на это
		}); // то напишите мне в вк
	}); // он указан сверху.
}; //третий callback hell
 
module.exports = {method, groupLongPoll, userLongPoll} // сколько раз тебе повторять воспользуйся ломом пушка здесь говно
